и вела себя так, как не положено ученице сельской школы». А факт в том, что я ни разу никого словами не оскорбляла, я никому плохого не делала. Самое глупое во всей этой ситуации, что доверять парням было крайне сложно. Был огромный страх при виде парней, любых парней. Даже если после школы я поступила в ПТУ и у меня на тот момент появились ребята из моей бурсы, но боязнь к парням не исчезала. Ведь помимо насмешек, избиений, меня неоднократно домогались в сексуальном смысле... Всё было будто в тумане, как долгий и страшный сон. В конце концов никто из обидчиков не извинялся передо мной за содеянное, ибо для всех я была жирным уродливым чудовищем. Про момент с кислой на уроке химии я вообще молчу. Но не смотря на прошлое и неудачное школьное прошлое, у меня сейчас потихоньку всё налаживается, заканчивается та длинная чёрная полоса. Правда, любить себя, свою внешность я не стала, для меня это слишком сложный этап в жизни...
